import React, { useState } from 'react';
import { DndProvider, useDrag, useDrop } from 'react-dnd';
import { HTML5Backend } from 'react-dnd-html5-backend';

const LOGIC_BLOCKS = [
  { label: 'Smart Buys in 10m', type: 'smart-buys', color: 'green', icon: 'üß†' },
  { label: 'Volume Spike > X%', type: 'volume-spike', color: 'blue', icon: 'üìà' },
  { label: 'Exclude Exit Liquidity', type: 'exclude-exit', color: 'red', icon: 'üö´' },
  { label: 'GambleFi Tag', type: 'narrative', color: 'purple', icon: 'üé≤' },
];

function LogicBlock({ label, type, color, icon }) {
  const [, drag] = useDrag(() => ({
    type: 'block',
    item: { type, label, color, icon },
  }), [type, label, color, icon]);
  return (
    <div
      ref={drag}
      className={`flex items-center gap-2 bg-neutral-800 rounded-lg px-4 py-2 cursor-move hover:bg-neutral-700 transition-all duration-200 shadow group border-l-4 border-${color}-400`}
    >
      <span className="text-xl">{icon}</span>
      <span className="font-semibold text-base text-white group-hover:text-white/90 transition">{label}</span>
    </div>
  );
}

function StrategyCanvas({ onDrop, logicBlocks, setLogicBlocks }) {
  const [{ isOver }, drop] = useDrop(() => ({
    accept: 'block',
    drop: (item) => onDrop(item),
    collect: (monitor) => ({
      isOver: monitor.isOver(),
    }),
  }), [onDrop]);

  const handleRemove = (idx) => {
    setLogicBlocks((prev) => prev.filter((_, i) => i !== idx));
  };

  const handleClear = () => setLogicBlocks([]);

  return (
    <div className="flex flex-col flex-1">
      <div className="flex justify-between items-center mb-4">
        <h2 className="text-xl font-semibold">‚öôÔ∏è Strategy Canvas</h2>
        <button onClick={handleClear} className="text-xs bg-neutral-700 px-3 py-1 rounded hover:bg-neutral-600 transition-all">Clear All</button>
      </div>
      <div
        ref={drop}
        className={`flex-1 border border-neutral-700 rounded-md p-4 text-neutral-500 bg-neutral-950 transition-all duration-200 ${isOver ? 'border-blue-400 shadow-lg' : ''}`}
      >
        {logicBlocks.length === 0 ? (
          <div className="flex items-center justify-center h-full text-neutral-600 text-center">
            [Drag logic blocks here to build your strategy]
          </div>
        ) : (
          <div className="flex flex-wrap gap-2">
            {logicBlocks.map((b, i) => (
              <span key={i} className={`flex items-center gap-2 px-3 py-1 rounded font-semibold text-base shadow bg-${b.color}-900/60 text-${b.color}-200 transition-all duration-200 bg-opacity-80`}> 
                <span className="mr-1">{b.icon}</span>
                {b.label}
                <button
                  className="ml-1 text-red-400 hover:text-red-600 text-xs font-bold px-1"
                  onClick={() => handleRemove(i)}
                  title="Remove block"
                >√ó</button>
              </span>
            ))}
          </div>
        )}
      </div>
      <button className="mt-6 w-full py-2 rounded-xl bg-blue-600 hover:bg-blue-500 font-bold text-lg transition-all duration-200 shadow-lg">‚ñ∂ Play Strategy</button>
    </div>
  );
}

const previewTokens = [
  { name: 'PAWPAW', risk: 'Low', meta: 'GambleFi', roi: '+24%' },
  { name: 'BABY BOB', risk: 'Low', meta: 'GambleFi', roi: '+34%' },
];

export default function CreateTab({ goBack }) {
  const [logicBlocks, setLogicBlocks] = useState([]);
  const handleDrop = (block) => setLogicBlocks((prev) => [...prev, { ...block }]);

  return (
    <DndProvider backend={HTML5Backend}>
      <div className="relative h-screen w-full bg-black text-white">
        {goBack && (
          <button
            onClick={goBack}
            className="absolute top-6 left-6 z-50 flex items-center text-sm text-blue-400 hover:underline focus:outline-none"
          >
            <span className="mr-2">‚Üê</span> Back to Home
          </button>
        )}
        <div className="grid grid-cols-3 gap-4 px-6 py-4 h-full">
          {/* Left: Logic Blocks */}
          <div className="bg-neutral-900 rounded-xl p-4 flex flex-col gap-4 shadow-lg">
            <h2 className="text-xl font-semibold">üß† Logic Blocks</h2>
            {LOGIC_BLOCKS.map((block) => (
              <LogicBlock key={block.type} {...block} />
            ))}
          </div>

          {/* Center: Strategy Flow Canvas */}
          <div className="bg-neutral-900 rounded-xl p-4 flex flex-col shadow-lg">
            <StrategyCanvas onDrop={handleDrop} logicBlocks={logicBlocks} setLogicBlocks={setLogicBlocks} />
          </div>

          {/* Right: Live Token Preview */}
          <div className="bg-neutral-900 rounded-xl p-4 shadow-lg flex flex-col">
            <div className="flex items-center justify-between mb-4">
              <h2 className="text-xl font-semibold">üì° Token Preview</h2>
              <span className="text-xs bg-green-800 px-2 py-0.5 rounded text-green-300">LIVE</span>
            </div>
            <div className="space-y-2">
              {previewTokens.map((t) => (
                <div key={t.name} className="bg-neutral-800 rounded-md p-3 flex justify-between items-center hover:bg-neutral-700 cursor-pointer transition-all duration-200">
                  <div>
                    <div className="font-semibold">{t.name}</div>
                    <div className="text-xs text-neutral-400">Risk: {t.risk} ‚Ä¢ Meta: {t.meta}</div>
                  </div>
                  <div className="text-green-400 font-bold">{t.roi}</div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </DndProvider>
  );
}
